import "./index.scss";

export const ResumeBooking = () => {
    return (
        <div>
            <Grid container className='generalResumeBooking'>
                <Grid item xs={1} className='limiteIzquierdo'>
                </Grid>
                <Grid item xs={10} className='tomoCentral'>

                    <div className='TechoDePantalla'>
                        <p className='TextSuperiorIzquierda'>Reuni贸n</p>
                        <ClearIcon className='SignoSalir' />
                    </div>

                    <div className='InformacionFoto'>
                        <p className='TextSuperiorIzquierda'>Reuni贸n</p>
                        <ClearIcon className='SignoSalir' />
                    </div>

                    <div className='InformacionDetalles'>
                        <p className='TextSuperiorIzquierda'>Reuni贸n</p>
                        <ClearIcon className='SignoSalir' />
                    </div>

                    <div className='CentralFooter'>
                    <button className='btnCancelarReu'>Cancelar reuni贸n <HighlightOffIcon/></button>
                    </div>
                </Grid>
                <Grid item xs={1} className='limiteDerecho'>
                </Grid>
            </Grid>
        </div>
    );
};
